import ComplainForm from 'book/Complain/ComplainForm';
import JoinForm from 'book/JOIN/JoinForm';
import ShareForm from 'book/Share/ShareForm';
import Bar from 'components/bar/Bar';
import Hero from 'components/hero/Hero';
import { useState } from 'react';
import { Container } from 'react-bootstrap';
import { Route, Routes } from 'react-router-dom';
import './App.css';

function App() {
  const [value, setValue] = useState<string>('');
  return (
    <div>
      <Container>
        <Bar />
        <Routes>
          <Route path="/" element={<Hero />} />
          <Route
            path="/joinForm"
            element={
              <JoinForm
                label="이메일"
                type="text"
                placeholder="이메일 주소를 입력해주세요"
                value={value}
                error={false}
                setValue={setValue}
                message="aa"
              />
            }
          />
          <Route path="/shareForm" element={<ShareForm />} />
          <Route path="/complainForm" element={<ComplainForm />} />
        </Routes>
      </Container>
    </div>
  );
}

export default App;
